function TinhTienDienTietKiem_BanLenLuoi_TheoHoTieuThu(dienluongthang, sodiendunghangthang, loaihotieuthu, bieugia, dienap, giatricaodiem, giatribinhthuong, giatrithapdiem) {

    var tientietkiem = 0;
    var tienban_lenluoi = 0;

    if (dienluongthang > sodiendunghangthang) {
        tienban_lenluoi = (dienluongthang - sodiendunghangthang) * GiaBanDien;
    }

    if (bieugia == "1Gia" && sodiendunghangthang != 0) {
        var giadien = GiaDienTheoBieu1GiaVaDienAp(loaihotieuthu, dienap);
        tientietkiem = Math.round(giadien * sodiendunghangthang);
    }
    else (bieugia == "3Gia" && sodiendunghangthang != 0)
    {
        if (giatrithapdiem == 100) {
            tientietkiem = 0;
            tienban_lenluoi = dienluongthang * GiaBanDien;
        }
        else
            tientietkiem = TinhTienDienTietKiem3Gia(loaihotieuthu, sodiendunghangthang, dienap, giatricaodiem, giatribinhthuong, giatrithapdiem)
    }

    return [tientietkiem, tienban_lenluoi];
}

function TinhSoDienTheoHoSinhHoat(tiendien, loaihotieuthu, bieugia, dienap, giatricaodiem, giatribinhthuong, giatrithapdiem) {
    var giadien = 1;
    var sodien = 0;

    if (loaihotieuthu == "sinhhoat") {
        return TinhSoDienTheoTienDien(tiendien);
    }
    else if (loaihotieuthu == "sanxuat" || loaihotieuthu == "thuongmai") {
        if (bieugia == "1Gia") {
            giadien = GiaDienTheoBieu1GiaVaDienAp(loaihotieuthu, dienap);
            sodien = Math.round(tiendien / giadien);
        }
        else if (bieugia == "3Gia") {
            sodien = TinhSoDien3GiaTheoGio(tiendien, loaihotieuthu, dienap, giatricaodiem, giatribinhthuong, giatrithapdiem);
        }
    }
    return sodien;
}

