function UpdateKetQuaBQ(isKHEVN, indexNhaCC, congsuatlapdat, loaihotieuthu, bieugia, dienap, sodienhangthang, tongtiendautu, tyledungbanngay, giatricaodiem, giatribinhthuong, giatrithapdiem, tongsotienlai) {
    var data = DienLuongTheoCongSuat(congsuatlapdat);
    var dataLS = [];

    if (isKHEVN) {
        dataLS = LichSuSDDien();
    }
    else {
        for (var i = 0; i < 12; i++) {
            dataLS[i] = sodienhangthang;
        }
    }

    var tongtienTK = 0;
    var tongtienbanchoEVN = 0;

    for (var i = 0; i < data.length; i++) {
        var dienmt = data[i];
        var diensd = dataLS[i];
        var dienTK = 0;

        if (dienmt <= diensd)
            dienTK = dienmt;
        else
            dienTK = diensd;


        var sanluongdienbanlenluoi = 0;
        var tientietkiemhangthang = 0;
        var tiendienbanlenluoi = 0;

        if (loaihotieuthu == "sinhhoat") {
            dienTK = tyledungbanngay / 100 * dienTK;
            if (dienmt > dienTK)
                sanluongdienbanlenluoi = dienmt - dienTK;

            tientietkiemhangthang = Math.round(TinhTienDienTheoSoDien(dienTK));
            tiendienbanlenluoi = Math.round(sanluongdienbanlenluoi * GiaBanDien);
        } else {
            var arr = TinhTienDienTietKiem_BanLenLuoi_TheoHoTieuThu(dienmt, dienTK, loaihotieuthu, bieugia, dienap, giatricaodiem, giatribinhthuong, giatrithapdiem);

            tientietkiemhangthang = arr[0];
            tiendienbanlenluoi = arr[1];
        }

        tongtienTK = tongtienTK + tientietkiemhangthang;
        tongtienbanchoEVN = tongtienbanchoEVN + tiendienbanlenluoi;
    }

    var tienTKBQThang = Math.round(tongtienTK / 12);
    var tienbanchoEVNBQThang = Math.round(tongtienbanchoEVN / 12);
    var tongloiichcanam = Math.round(tongtienTK + tongtienbanchoEVN);
    var tongloiichcadoiduan = tongloiichcanam * 25;
    var tgianhoanvonKoVay = (tongtiendautu / tongloiichcanam).toFixed(2);
    var tgianhoanvonCoVay = ((tongtiendautu + tongsotienlai) / tongloiichcanam).toFixed(2);

    $(".sotientietkiemhangthang" + indexNhaCC).text(numberWithCommas(tienTKBQThang));
    $(".sotienbanduochangthang" + indexNhaCC).text(numberWithCommas(tienbanchoEVNBQThang));
    $(".sotientietkiemcanam" + indexNhaCC).text(numberWithCommas(tongloiichcanam));
    $(".sotientietkiemcadoi" + indexNhaCC).text(numberWithCommas(tongloiichcadoiduan));
    $("#sonamhoanvonkovay" + indexNhaCC).text(tgianhoanvonKoVay.toString().replace(".", ","));
    $("#sonamhoanvon" + indexNhaCC).text(tgianhoanvonCoVay.toString().replace(".", ","));
}

