function LichSuSDDien() {
    var dataLS = [];
    if (window.ListDienTThu != null && window.ListDienTThu.length > 0) {
        for (var i = 0; i < 12; i++) {
            var thang = i + 1;
            var sodienLS = SetLichSuSDDien(thang);
            dataLS[i] = sodienLS;
        }
    }
    else
        for (var i = 0; i < 12; i++) {
            dataLS[i] = 0;
        }
    return dataLS;
}

function SetLichSuSDDien(thang) {
    var ls = _.findWhere(window.ListDienTThu, { Thang: thang });
    if (ls != undefined)
        return ls.SanLuong;
    return 0;
}

