function PMT(ir, np, pv, fv) {
	if (!fv) {
		fv = 0;
	}
	var pmt = (ir * (pv * Math.pow(ir + 1, np) + fv)) / (Math.pow(ir + 1, np) - 1);
	return pmt;
}

function dateOfMonth(day, month, year) {
	var monthDay;
	var leapYear = false;
	year = parseInt(year);
	if (year / 100) {
		if (year % 4 === 0 || year % 400 === 0) {
			leapYear = true;
		}
	}
	if (month === 2) {
		if (leapYear) {
			monthDay = 29;
		} else {
			monthDay = 28;
		}
	} else if (month === 4 || month === 6 || month === 9 || month === 11) {
		monthDay = 30;
	} else {
		monthDay = 31;
	}
	return monthDay;
}
function calculatorInterest(borrow, interestRate, day) {
	var interest = borrow * interestRate;
	return interest;
}
function calculatorRegressive(borrow, term, interestRate) {
	var interestRateMonth = interestRate / 12;
	var ending;
	var today = new Date();
	var day = today.getDate();
	var month = today.getMonth() + 1;
	var year = today.getFullYear();
	var principal,
		meta = [],
		data = {},
		dateMonth,
		interest;
	var monthlyPayment = PMT(interestRateMonth, term, borrow);
	var totalInterest = 0;
	var totalPayment = monthlyPayment * (term - 1);
	var firstPayment = monthlyPayment;
	if (term) {
		for (var i = 0; i < term; i++) {
			var obj = {};
			if (i) {
				month = month === 12 ? 1 : month + 1;
			}
			if (i && month === 1) {
				year += 1;
			}
			dateMonth = dateOfMonth(day, month, year);
			if (i == 0) {
				interest = calculatorInterest(borrow, interestRateMonth, dateMonth);
			} else {
				interest = calculatorInterest(ending, interestRateMonth, dateMonth);
			}
			totalInterest += interest;
			principal = monthlyPayment - interest;
			if (i) {
				borrow = ending;
				ending = ending - principal;
			} else {
				ending = borrow - principal;
			}
			if (i === term - 1) {
				monthlyPayment = interest + borrow;
				principal = monthlyPayment - interest;
				totalPayment += monthlyPayment;
				ending = 0;
			}
			obj.monthlyPayment = Math.round(monthlyPayment);
			obj.ending = Math.round(ending);
			obj.principal = Math.round(principal);
			obj.interest = Math.round(interest);
			obj.borrow = Math.round(borrow);
			meta.push(obj);
		}
		data.totalPayment = parseInt(totalPayment);
		data.totalInterest = parseInt(totalInterest);
		data.firstPayment = parseInt(firstPayment);
		data.meta = meta;
	} else {
		data.totalPayment = 0;
		data.totalInterest = 0;
		data.firstPayment = 0;
		data.meta = 0;
	}
	return data;
}
function calculatorFixed(borrow, term, interestRate, currency) {
	var interestRateMonth = interestRate / 12;
	var ending;
	var today = new Date();
	var day = today.getDate();
	var month = today.getMonth() + 1;
	var year = today.getFullYear();
	var principal,
		meta = [],
		data = {},
		dateMonth,
		interest,
		monthlyPayment;
	var totalInterest = 0;
	var totalPayment = 0;
	var firstPayment;
	principal = borrow / term;
	currency = currency || "";
	if (term) {
		principal = principal;
		if (currency.toLowerCase() === "usd") {
			principal = Math.min(principal, 1);
		}
		for (var i = 0; i < term; i++) {
			var obj = {};
			if (i) {
				month = month === 12 ? 1 : month + 1;
			}
			if (i && month === 1) {
				year += 1;
			}
			dateMonth = dateOfMonth(day, month, year);
			if (i == 0) {
				interest = calculatorInterest(borrow, interestRateMonth, dateMonth);
			} else {
				interest = calculatorInterest(ending, interestRateMonth, dateMonth);
			}
			monthlyPayment = interest + principal;
			if (i === 0) {
				firstPayment = monthlyPayment;
			}
			if (i) {
				borrow = ending;
				ending = ending - principal;
			} else {
				ending = borrow - principal;
			}
			if (i === term - 1) {
				principal = borrow > principal ? principal : borrow;
				monthlyPayment = interest + principal;
				ending = 0;
			}
			if (ending < 0) {
				monthlyPayment = 0;
			}
			totalPayment += monthlyPayment;
			totalInterest += interest;
			monthlyPayment = Math.max(monthlyPayment, 0);
			ending = Math.max(ending, 0);
			principal = Math.max(principal, 0);
			interest = Math.max(interest, 0);
			obj.monthlyPayment = Math.round(monthlyPayment);
			obj.ending = Math.round(ending);
			obj.principal = Math.round(principal);
			obj.interest = Math.round(interest);
			obj.borrow = Math.round(borrow);
			meta.push(obj);
		}
		data.meta = meta;
		data.totalPayment = parseInt(totalPayment);
		data.totalInterest = parseInt(totalInterest);
		data.firstPayment = parseInt(firstPayment);
	} else {
		data.meta = 0;
		data.totalPayment = 0;
		data.totalInterest = 0;
		data.firstPayment = 0;
	}
	return data;
}
function rePay(ppt, tienvay, kyhan, laisuat) {
	if (tienvay > 0 && kyhan > 0 && laisuat > 0) {
		var rs = new Array(kyhan);
		if (ppt) {
			var stg = Math.floor(tienvay / kyhan);
			var duno = tienvay;
			var dugoc = tienvay;
			rs = calculatorFixed(tienvay, kyhan, laisuat);
			return rs;
		} else {
			var dnht = tienvay;
			rs = calculatorRegressive(tienvay, kyhan, laisuat, "");
			return rs;
		}
	}
	return [];
}

