		+ "<th width=\"20%\" align=\"center\" class=\"text-center\">Tổng gốc + Lãi</th>"
		+ "</tr>";

	for (var i = 0; i < meta.length; i++) {
		html += "<tr>"
			+ "<td width=\"20%\" align=\"center\">" + (i+1) + "</td>"
			+ "<td width=\"20%\" align=\"center\">" + converNumber(meta[i].gocconlai) + "</td>"
			+ "<td width=\"20%\" align=\"center\">" + converNumber(meta[i].goctratrongky) + "</td>"
			+ "<td width=\"20%\" align=\"center\">" + converNumber(meta[i].lai) + "</td>"
			+ "<td width=\"20%\" align=\"center\">" + converNumber(meta[i].tongGocLai) + "</td>"
			+ "</tr>"
	}

	html += "<tr>"
		+ "<th width=\"20%\" align=\"center\">Tổng</th>"
		+ "<th width=\"20%\" align=\"center\"></th>"
		+ "<th width=\"20%\" align=\"center\" class=\"text-center\">" + converNumber(Math.round(data.sum_goc)) + "</th>"
		+ "<th width=\"20%\" align=\"center\" class=\"text-center\">" + converNumber(Math.round(data.sum_lai)) + "</th>"
		+ "<th width=\"20%\" align=\"center\" class=\"text-center\">" + converNumber(Math.round(data.sum_goc_lai)) + "</th>"
		+ "</tr>"

	html += "</table>";
	document.getElementById("listRepayment" + idso).innerHTML = html;
