function NextToPharseTwo() {
    var makhachhang = $('#EVNCustomerId').val();
    var tinhthanh = $("#ProvinceId").val();

    if (makhachhang == '' && tinhthanh == '') {
        Swal.fire({
            title: 'Có lỗi xảy ra',
            text: 'Vui lòng nhập mã khách hàng EVN hoặc Địa chỉ'
        })
        return;
    }
    GetData(makhachhang, tinhthanh);
}

function GetData(maKHang, maTinh) {
    var url = $('#request_pharse_one_url').val();
    $.ajax({
        url: url + "/",
        type: "POST",
        dataType: "json",
        data: {
            maKHang: maKHang,
            maTinh: maTinh
        },
        beforeSend: function () {
            ShowHideLoadingPanel(true);
            $("#phrase-one").prop('disabled', true);
        },
        success: function (data) {
            if (data.result) {
                var khachHang = data.KhachHang;
                window.KhachHang = data.KhachHang;

                var hoTieuThu = data.HoTieuThu;
                window.HoTieuThu = data.HoTieuThu;

                window.SolarRadiation = data.SolarRadiation;
                window.DienLuongThang = data.DienLuongThang;
                window.DiemDo = data.DiemDo;
                window.ListDienTThu = data.ListDienTThu;
                var diachilapdat = "";
                if (data.IsKHEVN) {
                    $("#plan-noncode").addClass("dis-none");
                    $("#plan-code").removeClass("dis-none");

                    $("#ma_kh").val(khachHang.MaKhang);
                    $("#ten_kh").val(khachHang.TenKhang);
                    $("#ma_kh").val(khachHang.MaKhang);

                    $("#input_loaihotieuthu").val(hoTieuThu.TenLoaiHoTieuThu);
                    $("#loaihotieuthu").val(hoTieuThu.MaLoaiHoTieuThu);
                    var isSinhHoat = true;

                    if (hoTieuThu.MaLoaiHoTieuThu == "sanxuat") {
                        isSinhHoat = false;
                        RemoveDienApSanXuat_Code();
                    }
                    else if (hoTieuThu.MaLoaiHoTieuThu == "thuongmai") {
                        isSinhHoat = false;
                        RemoveDienApThuongMai_Code();
                    }
                    DatThamSoSanXuat_Code(hoTieuThu.DienAp, hoTieuThu.BieuGia);
                    SetAnHienThamSoHoTieuThu_Code(isSinhHoat);
                    SetAnHienThoiGianSDDien_Code(hoTieuThu.BieuGia);
                    DatDienTich_Code(hoTieuThu.MaLoaiHoTieuThu);

                    diachilapdat = data.KhachHang.DuongPho;
                }
                else {
                    $("#loaihotieuthu").val("sinhhoat");
                    $("#plan-code").addClass("dis-none");
                    $("#plan-noncode").removeClass("dis-none");
                    //diachilapdat = $("#ProvinceId option:selected").html();
                    diachilapdat = $("#google_map_address").val();
                }
                $("#diachilapdat").text(diachilapdat);
                $("#isKHEVN").val(data.IsKHEVN);
                $("#step-one").addClass("dis-none");
                $("#step-two").removeClass("dis-none");
            }
            else {
                ShowSweatAlert("Error !", data.message, "error");
            }
        },
        error: function (xhr, error, code) {
            ShowSweatAlert("Error !", xhr.responseText, "error");
        },
        complete: function () {
            ShowHideLoadingPanel();
            $("#phrase-one").prop('disabled', false);
        }
    });
};
